import React from 'react';
import styles from './MenuItem.module.css';

const MenuItem = props => {
  let itemContent;

  if (props.icon) {
    itemContent = <i className={props.icon}></i>;
  } else if (props.number) {
    itemContent = <div className={styles.Number}>{props.number}</div>;
  }

  return (
    <div
      className={styles.MenuItem + ' ' + (props.active && styles.ActiveItem)}
    >
      {props.active && <div className={styles.ActiveBorder} />}

      <div className={styles.Content}>
        <div className={styles.Icon}>{itemContent}</div>
        {props.name}
      </div>
    </div>
  );
};

export default MenuItem;
